import React from 'react';
import "./Sixth.css";

const Sixth = () => {
  return (
    <div className='container-fluid fifth'>
    {/* <div className='row'>
        <div className='col-md-12 fifth-heading'>
        <h2>Assisted Living With A Customized Care</h2>
        </div>
    </div> */}

    <div className='row'>
            <div className='col-md-6'>
             <img className='fifth-image' src='../fifth1.png'/>
            </div>
            <div className='col-md-6'>
            <p className='fifth-text1'>As you embark on life post-retirement, your seniors require extra care that verifies all the touch-points in their elder life. Keeping this in mind, Athulya provides your seniors with customized care that is unique and personalized for your senior. It also allows your seniors to be fully in control of their time and decisions. With extensive facilities of medical care round the clock, Advanced technology for monitoring, healthy & nutritious food options, entertainment, wellness programs, and mindfulness activities - Athulya also lets you choose the rental ownership that is comfortable and best suited for your luxury retirement homes. Thus enabling you to decide the duration you want to stay with us.</p>
            </div>
        </div>
    </div>
  )
}

export default Sixth
